X-Force has barely survived an encounter with their newest foe&mdash;the swaggering superhuman arms dealer VOLGA&hellip;
&hellip;and with their secrets brought to light, they&#39;re barely surviving EACH OTHER. How will Cable&#39;s team keep it together to carry out their mission?
Well I can tell you part of the answer: DOMINO is back! But she could just be in over her head already&hellip;

